import React from "react";
import "./animeHome.css";
import $ from "jquery";
// import AnimeSidebar from "../components/sidebars/AnimeSidebar";
// import Navbar from "../components/navbar/Navbar";

const AnimeHome = () => {
  $(function () {
    $(".test1").click(function () {
      $(".test2").css("display", "none");
    });
  });

  return (
    <div class="relative">
      <button
        class="btn btn-sidebar block lg:hidden"
        onclick="document.getElementById('sidebar').classList.toggle('hidden')"
      >
        <svg class="w-5 h-5" viewBox="0 0 20 20" fill="currentColor">
          <path
            fill-rule="evenodd"
            d="M3 5a1 1 0 011-1h12a1 1 0 110 2H4a1 1 0 01-1-1zM3 10a1 1 0 011-1h12a1 1 0 110 2H4a1 1 0 01-1-1zM3 15a1 1 0 011-1h12a1 1 0 110 2H4a1 1 0 01-1-1z"
            clip-rule="evenodd"
          />
        </svg>
      </button>
      <nav
        id="sidebar"
        class="fixed top-0 left-0 bottom-0 w-64 bg-white border-r border-gray-200 hidden lg:block"
      >
        <div class="p-6"></div>
      </nav>
      <div class="ml-64 lg:ml-0"></div>
    </div>
  );
};

export default AnimeHome;
